import { Button } from 'antd';
import Link from 'next/link';

import './App.css';

const Form = () => {
  return (
    <div>
      <p>This is the about page</p>

      <ul>
	<li>
	      <Link href="/">
		<a>Home</a>
	      </Link>
	</li>
	<li>
	      <Link href="/about">
		<a>About</a>
	      </Link>
	</li>
      </ul>

      <Button type="primary">Button</Button>

    </div>
  );
};

export default Form;
